import React from "react";
import HomePage from "./HomePage";

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state={apiResponse: ""};
  }

  callAPI() {
    fetch("http://localhost:9000")
        .then(res => res.text())
        .then(res => this.setState({apiResponse: res}));
   }

   componentWillMount() {
    this.callAPI();
   }

  render(){
    return(
      <HomePage />
    );
  }
}

export default App;
